Properties.Body:
{{ 'Global' | Attribute:'EmailHeader' }}

<p>{{ Person.NickName }},</p>
<p>The following {{ Workflow.WorkflowType.WorkTerm}} requires action:<p>
<p><a href='{{ 'Global' | Attribute:'InternalApplicationRoot' }}WorkflowEntry/{{ Workflow.WorkflowTypeId }}?WorkflowGuid={{ Workflow.Guid }}'>{{ Workflow.Name }}</a></p>

{% assign RequiredFields = false %}

<h3 class="separator">Details</h3>



{% for attribute in Action.FormAttributes %}


    {% if attribute.IsVisible and attribute.Value != '' %}
        <div>
            <strong>{{ attribute.Name }}:</strong>
            <br />

                {% if attribute.Url and attribute.Url != '' %}
                    <a href='{{ attribute.Url }}'>{{ attribute.Value }}</a>
                {% else %}
                    {{ attribute.Value }}
                {% endif %}

        </div>
        <br />
    {% endif %}


    {% if attribute.IsRequired && attribute.Value == Empty %}
        {% assign RequiredFields = true %}
    {% endif %}

{% endfor %}



<table width="100%">
    <tr>
        <td>

    <table align="left" style="width: 29%; min-width: 190px; margin-bottom: 12px;" cellpadding="0" cellspacing="0">
     <tr>
       <td>

    		<div><!--[if mso]>
    		  <v:roundrect xmlns:v="urn:schemas-microsoft-com:vml" xmlns:w="urn:schemas-microsoft-com:office:word" href="{{ 'Global' | Attribute:'InternalApplicationRoot' }}WorkflowEntry/{{ Workflow.WorkflowTypeId }}?WorkflowGuid={{ Workflow.Guid }}" style="height:38px;v-text-anchor:middle;width:175px;" arcsize="11%" strokecolor="#269abc" fillcolor="#31b0d5">
    			<w:anchorlock/>
    			<center style="color:#ffffff;font-family:sans-serif;font-size:14px;font-weight:normal;">View Details</center>
    		  </v:roundrect>
    		<![endif]--><a href="{{ 'Global' | Attribute:'InternalApplicationRoot' }}WorkflowEntry/{{ Workflow.WorkflowTypeId }}?WorkflowGuid={{ Workflow.Guid }}"
    		style="background-color:#31b0d5;border:1px solid #269abc;border-radius:4px;color:#ffffff;display:inline-block;font-family:sans-serif;font-size:14px;font-weight:normal;line-height:38px;text-align:center;text-decoration:none;width:175px;-webkit-text-size-adjust:none;mso-hide:all;">View Details</a></div>

    	</td>
     </tr>
    </table>

    {% if Action.ActionType.WorkflowForm.IncludeActionsInNotification == true %}

        {% if RequiredFields != true %}

            {% for button in Action.ActionType.WorkflowForm.Buttons %}
                {% capture ButtonLinkSearch %}{% raw %}{{ ButtonLink }}{% endraw %}{% endcapture %}
                {% capture ButtonLinkReplace %}{{ 'Global' | Attribute:'InternalApplicationRoot' }}WorkflowEntry/{{ Workflow.WorkflowTypeId }}?WorkflowGuid={{ Workflow.Guid }}&ActionId={{ Action.Id }}&Command={{ button.Name }}{% endcapture %}
                {% capture ButtonHtml %}{{ button.EmailHtml | Replace: ButtonLinkSearch, ButtonLinkReplace }}{% endcapture %}

                {% capture ButtonTextSearch %}{% raw %}{{ ButtonText }}{% endraw %}{% endcapture %}
                {% capture ButtonTextReplace %}{{ button.Name }}{% endcapture %}
                {{ ButtonHtml | Replace: ButtonTextSearch, ButtonTextReplace }}
            {% endfor %}
        {% endif %}

    {% endif %}

        </td>
    </tr>
</table>


{{ 'Global' | Attribute:'EmailFooter' }}

Properties.Value:
{{ 'Global' | Attribute:'EmailHeader' }}

Congratulations {{ Workflow.FirstName}},<br /><br />


{% assign thirdpartyreg = Workflow.3rdPartyWebsiteLinkRegistration %}
{% if thirdpartyreg == '' %}
You have been approved for the {{ Workflow.MissionTripGroup }} trip! FG requires a non-refundable deposit from each trip participant. Please take a moment to login on the website and visit the <a href="{{ 'Global' | Attribute:'PublicApplicationRoot' }}page/736?GroupId={{ Workflow.MissionTripGroupId }}">trip page</a> to make your initial deposit of {{ Workflow.MissionTripDeposit }} by clicking the Make a Payment button.<br /><br /> 

Once you have paid your deposit, you can click the "Participant Page" button and begin to edit your page to include information about your trip. This is a helpful tool you can use for personal fundraising. You will also visit this page to track your fundraising progress and make any additional payments.<br /><br />

{% else %}
You have been approved for the {{ Workflow.MissionTripGroup }} trip! Upon registration for this trip, you will be required to pay a non-refundable deposit of {{ Workflow.MissionTripDeposit }}. Please take a moment to log in on our partner's website {{ thirdpartyreg }} and begin the process of registering and paying your deposit.<br /><br />
Once you have created your trip account, you can begin the process of raising trip funds! People can contribute to your trip by visiting {{ Workflow.3rdPartyWebsiteLinkContributions }} and following any listed prompts.<br /><br />
{% endif %}
If you have any questions, please don't hesitate to contact <a href="{{ 'Global' | Attribute:'PublicApplicationRoot' }}staff/contact/7465">Jana Johnson</a>.<br /><br />

Thank you.<br /><br />


Outreach Team<br /><br />


{{ 'Global' | Attribute:'OrganizationName' }}<br />


{{ 'Global' | Attribute:'EmailFooter' }}
